import React from 'react';

const PDFViewer = () => {
  const pdfFile = '/a.pdf';

  const openPDF = () => {
    const link = document.createElement('a');
    link.href = pdfFile;
    link.target = '_blank';
    link.rel = 'noopener noreferrer';
    link.click();
  };

  return (
    <div>
      <button onClick={openPDF}>Open PDF</button>
    </div>
  );
};

export default PDFViewer;
